import React from 'react';
import './Hasil.css';

function Hasil() {
    return (
        <div>
            <body className="App-hasil">
                <p>Step berapa:</p>
                <div className="hasil-angka">
                    <p>1,2,3,4,5</p>
                </div>
            </body>
        </div>
    );


}
export default Hasil;
